import styled from "styled-components";

const Container = styled.div`
border:5px solid #44045f;
margin: 5px;
padding-bottom: 20px;
align-items: center;
background-color: #3a0850;
color: beige;
border-radius: 8%;
width:30%;
height: 40%;
position: relative;
font-size: 90%;

`;

const Buttons = styled.button`
  border-radius: 5px;
  margin: 10px;
  padding: 5px;
  background-color: #03f907;
  color: rgb(5, 90, 33);
  position: absolute;
  top: 3%;
  left: 85%;

`;

const Name=styled.h2`
position: absolute;
bottom: 2%;
left: 13%;
color: black;
background-color: #03f907;
border-radius: 5px;
`

const Img=styled.img`

`
export default function Card(props) {
  return (
    <Container>
      <Buttons onClick={() => {props.onClose();}}>X</Buttons>
      <Name>{props.name}</Name>
      <h2>{props.status}</h2>
      <h2>{props.species}</h2>
      <h2>{props.gender}</h2>
      <h2>{props.origin}</h2>
      <img src={props.image} alt="" />
    </Container>
  );
}
